According to the WHO (16/03/2015) the outbreak of Ebola Haemorrhagic Fever in West Africa has recorded more than 24,000 confirmed and suspected cases to date, across West Africa including 10,144 deaths. 48% of all cases have occurred in Sierra Leone , the country hardest hit by the outbreak, but the true impact is far greater. The ACAPs Ebola situation update (09-16 March) demonstrates this greater impact on food security, nutrition, child protection and spread of disease.
The negative impact of EVD on the communities continues, In addition, schools were closed since July 2014 as many were transformed into Community Care Centres (CCC) and even though these have been re-open there are issues with parents allowing their children to attend school.  The poorest and most vulnerable members of the communities, including older people, people with disabilities, children, young girls and women, have been hit the hardest. For example, older men and women due to their traditional caring roles in the community; people with disabilities due to restricted mobility, loss of sight; young girls who have not been at school have been at risk of becoming pregnant and have heightened protection issues due to lack of schooling over long periods. 
CAFODs work on the ground has identified that orphans and widows, carers, often older aged women and young children as other specific vulnerable groups, especially in households where both parents, including the bread winner, has died due to EVD and grandparents or adolescent siblings have assumed a carers role.  
The project seek to achieve the following;
a) 1,325 vulnerable Ebola affected  individuals (focus on women and girls) demonstrate improved livelihoods and food security by end of month 12; 
b) By month 12 at least 2,250 vulnerable persons affected by EVD demonstrate improved wellbeing as a result of psychosocial support provided across 2 districts; 
c) At least 350 vulnerable children are reunited with family members by month 12 as a result of improved protection services being provided across two districts; 
d) At least 1,200 girls and boys return to school and their education is resumed by month 6, as a result of providing basic school support/equipment and materials in two districts; 
e) project partners demonstrate strengthened capacity to ensure improved coordination, accountability and that compliance to international standards are met.
